import React from 'react';
import {
    View,
    TextInput,
    Button,
    StyleSheet
} from 'react-native';

const ReminderInput = (props) => {
    return (
        <View style={styles.reminderView}>
            <TextInput
                placeholder="Lembrar..."
            />
        </View>
    )
}

export default ReminderInput;
